import React, { useState, useEffect } from "react";
import axios from "axios";
function Secondprofile({secondProfile, setSecondProfile}) {
    const [loading, setLoading] = useState(true);
    let platform = "psn";
    let region = "us";
    let profile = "Evolvd444"; 
    const allStatsURL = `https://ow-api.com/v1/stats/${platform}/${region}/${profile}/complete`;

    useEffect(() => {
      const getData = async () => {
        const res = await axios.get(allStatsURL);

        setSecondProfile(res.data);
        setLoading(false);
      }
      getData()
    }, []);

    if (loading) {
      return <h1> Loading</h1>;
    } else {
      console.log(secondProfile.rating);
      return (
          <div>
           <label for="gsearch">Search Profile:</label>
